import React from 'react'

class CasaAp extends React.Component {
  render() {
    const { options, type, name, onClick } = this.props
    return(
      <>
        {options.map((element) => (<input type={type} text={element} name="tipo" onClick={onClick} required />))}
      </>
    )
  }
}

export default CasaAp
